import React from 'react';
import Stack from "@mui/material/Stack";
import { RotationItem } from './RotationItem';
import { Paper } from '@mui/material';
import useRotationStack from '../../../store/useRotationStack';

type Props = {
    flights: any;
};


const Rotation: React.FC<Props> = ({flights}) => {
    const { flightsRotation } = useRotationStack((state) => ({
      flightsRotation: state.flightsRotation,
    }));

    return (
      <Paper sx={{ height: "90vh", width: "30vh" }}>
        <Stack
          direction="column"
          justifyContent="space-evenly"
          alignItems="center"
          spacing={2}
        >
          {flights.map((flight: Flight) => (
            <RotationItem flight={flight} />
          ))}
        </Stack>
      </Paper>
    );
};

export default Rotation;
